query:
/*+ NoMergeJoin(ci t) NoNestLoop(ci t mc) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id > 2726557 AND ci.role_id > 6 AND t.kind_id < 7 AND t.production_year > 1941
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id > 12981 AND mc.company_type_id < 2;
